   "source": [
    "df <- read_csv(\"/kaggle/input/technology-company-layoffs-20222023-data/tech_layoffs.csv\")\n",
    "\n",
    "df$date <- mdy(df$reported_date)\n",
    "\n",
    "df$year <- lubridate::year(df$date)\n",
    "df$month <- month(df$date,label = TRUE, abbr = FALSE)\n",
    "df$week <- wday(df$date,label = TRUE)\n",
    "df$impacted_workforce_percentage <-as.numeric(df$impacted_workforce_percentage)"
   ]
  },
